import React from 'react';
import './styles.css';
import {Link} from 'react-router-dom';
import {FiArrowLeft} from 'react-icons/fi';

//import api from '../../services/api';

import logoImg from '../../assets/logo.png';

export default function Register() {
    function handleRegister(e) {
        e.preventDefault();

    }

    return (
        <div className="register-container">
            <div className="content">
            <section>
            <img src={logoImg} alt="Cadastro Simples"/>

            <h1>Cadastro</h1>
            <p>Fa√ßa seu cadastro, entre na pataforma e ajude pessoas a encontrarem os casos da sua ONG.</p>
            <Link className="back-link" to  = "/"><FiArrowLeft size={16} color="#E02041"/>Tenho cadastro </Link> 
            </section>

            <form onSubmit={handleRegister}>
            <input placeholder="Nome da ONG"></input>
            <input type="email" placeholder="E-mail"></input>
            <input placeholder="Whatsapp"></input>
            <div className="input-group">
            <input placeholder="Cidade"></input>
            <input placeholder="UF" style={{width:80 }}></input>
            </div>
            <button className="button" type="submit">Cadastrar</button>

            </form>

            </div>
        </div>
    )
}
